function runHomePageCode(){try{homePageCode()}catch(n){console.error(n)}}function homePageCode(){function t(n){let t=n.currentTarget.id;window.location.href=`/Teachers/All?subjectId=${t}`}var n=Array.from(document.getElementsByClassName("schoolSubjectItem"));n.forEach(n=>n.addEventListener("click",t))}window.addEventListener("DOMContentLoaded",runHomePageCode);